import React from 'react';
import Square from './Square';

function retPosition(y,x){
  let yCord = y;
  let xCord = x % 8;

  let xAxis = ['a','b','c','d','e','f','g','h'];

  let retVal = xAxis[xCord]+yCord;
  //console.log(retVal);
  return retVal;
}

export default function mappedBoard(ar){

  var p = [];
  for(let i=8;i>=1;i--){
    for(let j=0;j<8;j++){
        p[i]=retPosition(i,j);
    }
  }
  for(let i=0;i<64;i++){
  return(
    <Square
      position={p[i]}
      pieceSrc={ar[i]}
    />
  )
}
}
